import banner from "../assets/img/banner.jpg";

const Home = () => {
  return (
    <div>
      <div>
        {/* <img src={banner} alt="Banner" style={{ width: '100%', height: 'auto' }} /> */}
      </div>
      <div>
        <h1>Mon offre de services</h1>
        <p>Voici les prestations sur lesquelles je peux intervenir</p>
      </div>
      <div></div>
    </div>
  );
};

export default Home;
